class KHE extends Component {

  constructor(props) {
    super(props);
    this.state = {
      selectedTab: 'dashTab',
    };
  }

  render() {
    return (
      StatusBarIOS.setStyle('light-content'),

      // TAB BAR IMPLEMENTATION
      <TabBarIOS
        selectedTab={this.state.selectedTab}
        tintColor="white"
        //#707070 #231F20
        barTintColor="black">


        {/* DASH BAR ITEM */}
        <TabBarIOS.Item
          title="Dash"
          icon={{uri: HeartBase64Icon, scale: 17}}
          selected={this.state.selectedTab === 'dashTab'}
          onPress={() => {
            this.setState({
              selectedTab: 'dashTab',
              isLoading: true
            });
          }}>
        <Dash />
        </TabBarIOS.Item>



        <TabBarIOS.Item
          title="Schedule"
          icon={{uri: CloverBase64Icon, scale: 17}}
          selected={this.state.selectedTab === 'scheduleTab'}
          onPress={() => {
            this.setState({
              selectedTab: 'scheduleTab',
              isLoading: true
            });
          }}>
        <ScheduleList />
        </TabBarIOS.Item>



        <TabBarIOS.Item
          title="Updates"
          icon={{uri: DiamondBase64Icon, scale: 17}}
          badge={this.state.notifCount > 0 ? this.state.notifCount : undefined}
          selected={this.state.selectedTab === 'updatesTab'}
          onPress={() => {
            this.setState({
              selectedTab: 'updatesTab',
              isLoading: true,
              notifCount: this.state.notifCount = 0
            });
          }}>
        <UpdateList />
        </TabBarIOS.Item>


        <TabBarIOS.Item
          title="Links"
          icon={{uri: SpadeBase64Icon, scale: 17}}
          selected={this.state.selectedTab === 'linksTab'}
          onPress={() => {
            this.setState({
              selectedTab: 'linksTab',
              isLoading: true
            });
          }}>
        <Links />
        </TabBarIOS.Item>


      </TabBarIOS>
    );
  }
};

AppRegistry.registerComponent('KHE', () => KHE);
